// IMPORTS
import '../../style/banner.css'
import '../../style/home.css'

// ASSETS
import Banner from '../../assets/banner-home.png'

// Page d'acceuil > Contient une bannière et les cards location
function Home() {
   return (
      <section className='homeContainer'>
         <div className='bannerContainer'>
            <img className='bannerImg' src={Banner} alt='Paysage' />
            <p className='bannerTexte'>Chez vous, partout et ailleurs...</p>
         </div>
         <div className='galeryCards'>
            <p>Page d'acceuil : Contient une bannière et galerie des cards location</p>
         </div>
      </section>
   )
 }

 export default Home
